/*global test  expect*/
let buddyStrings = require('../solution/buddyStrings').buddyStrings;


test('buddyStrings', () => {
	expect(buddyStrings('ab', 'ba')).toBe(true);
	expect(buddyStrings('ab', 'ab')).toBe(false);
	expect(buddyStrings('aa', 'aa')).toBe(true);
	expect(buddyStrings('aaaaaaabc', 'aaaaaaacb')).toBe(true);
	expect(buddyStrings('', 'aa')).toBe(false);
	expect(buddyStrings('abab', 'abab')).toBe(true);
	expect(buddyStrings('abcabc', 'abcabc')).toBe(true);
	expect(buddyStrings('','')).toBe(false);
});

